{
  "policyName": "my-api-policy",
  "policyType": "default",
  "trafficRuleSets": [
    {
      "ruleType": "traffic",
      "rules": [
        {
          "name": "rule1",
          "conditions": [
            {
              "conditionType": "SSL_EXTENSION_SERVERNAME",
              "operator": "equals",
              "values": [
                "test.f5labs.com"
              ]
            }
          ],
          "actions": [
            {
              "actionType": "SSL_PROXY_BYPASS"
            },
            {
              "actionType": "SERVICE_CHAIN",
              "serviceChain": "[add service-chain-id here]"
            }
          ]
        },
        {
          "name": "All Traffic",
          "conditions": [],
          "actions": [
            {
              "actionType": "SSL_PROXY_INTERCEPT"
            },
            {
              "actionType": "SERVICE_CHAIN",
              "serviceChain": "[add service-chain-id here]"
            }
          ]
        }
      ]
    }
  ],
  "loggingRuleSets": [
    {
      "ruleType": "logging",
      "rules": [
        {
          "name": "all-logging",
          "conditions": [
            {
              "conditionType": "L4_PORT",
              "operator": "equals",
              "values": [
                443
              ],
              "local": true
            }
          ],
          "actions": [
            {
              "actionType": "COLLECT_DATA"
            }
          ]
        }
      ]
    }
  ]
}

